import React, { Component } from 'react';
import Jumbotron from '../../components/Jumbotron';

class FrontPage extends Component {
  render() {
    return (
      <Jumbotron>
        <h1>Its cool JumboTron</h1>
      </Jumbotron>
    );
  }
}

export default FrontPage;
